import React from "react";
import "./myGallery.scss";
import Container from "react-bootstrap/Container";

function my_gallery() {
  return (
    <div className="container">
      <Container>
        <h1>Hello World</h1>
      </Container>
    </div>
  );
}

export default my_gallery;
